public class DBClusterFactory(string resourceName = null, Action<Humidifier.RDS.DBCluster> factoryAction = null) : ResourceFactory<Humidifier.RDS.DBCluster>(resourceName)
{

    internal List<InnerDBClusterDBClusterRoleFactory> AssociatedRolesFactories { get; set; } = [];

    internal InnerDBClusterServerlessV2ScalingConfigurationFactory ServerlessV2ScalingConfigurationFactory { get; set; }

    internal InnerDBClusterMasterUserSecretFactory MasterUserSecretFactory { get; set; }

    internal InnerDBClusterScalingConfigurationFactory ScalingConfigurationFactory { get; set; }

    protected override Humidifier.RDS.DBCluster Create()
    {
        var dBClusterResult = CreateDBCluster();
        factoryAction?.Invoke(dBClusterResult);

        return dBClusterResult;
    }

    private Humidifier.RDS.DBCluster CreateDBCluster()
    {
        var dBClusterResult = new Humidifier.RDS.DBCluster
        {
            GivenName = InputResourceName,
        };

        return dBClusterResult;
    }
    public override void CreateChildren(Humidifier.RDS.DBCluster result)
    {
        base.CreateChildren(result);

        result.AssociatedRoles = AssociatedRolesFactories.Any() ? AssociatedRolesFactories.Select(x => x.Build()).ToList() : null;
        result.ServerlessV2ScalingConfiguration ??= ServerlessV2ScalingConfigurationFactory?.Build();
        result.MasterUserSecret ??= MasterUserSecretFactory?.Build();
        result.ScalingConfiguration ??= ScalingConfigurationFactory?.Build();
    }

} // End Of Class

